                       <link rel="stylesheet" href="../../previsua.css"><title>Doom (2016) - An√°lisis</title><div id="Visitante"><?php include("../../../d/Parte/headerus2.html");?></div><br><br><br><br><body><section class="caviar-hero-area" id="home"><!-- Single Slides --><div><img style="position: absolute; width: 100%; height: 100%;" src="data:image/jpeg;base64," alt="Imagen de la publicaci√≥n"></div><div class="single-hero-slides bg-img"><div class="container h-100"><div class="cont"><div class="seccion"><p>MultiPlataforma<p></div></div><div class="row h-100 align-items-center" style="position: absolute; z-index: 5;"><div class="col-11 col-md-6 col-lg-4"><div class="hero-content"><h2 style="margin-left: -15%;">Doom (2016) - An√°lisis</h2><!--<p>Estos son los problemas y virtudes de la segunda mitad del juego.</p>--></div></div></div></div></div></section><section class="caviar-dish-menu mt-5 justify-content-between" id="menu" name="text"><div class="row justify-content-center"><div class="card bordered-dark mt-3" style="width: 70em; height: auto"><div class="card-body"><h2 class="text-center text-uppercase mt-4 sub" style="width: 33em; margin-bottom: 70px">El infierno no es para ap√°ticos</h2><div class="d-flex justify-content-around"><p class="text-light" style="font-size: 18px"><i class=" i bi bi-person-fill"></i> Creado por: ANGEL GABRIEL DIAZ RAMIREZ </p><img><p class="text-light" style="font-size: 18px"> <i class="i bi bi-calendar-minus"></i> Fecha: 2023-05-19 22:31:28</p></div></div></div><div class="card bordered-dark mt-5" style="width: 70em;"><div class="card-body text-light" style="font-size: 20px; margin-top: 3%; margin-left: 2%; margin-right: 2%; margin-bottom: 5%"><p class="text-light" style="font-size: 18px">Doom es ya una realidad. Por fin se ha puesto a la venta lo nuevo de id Software, estudio con un amplio bagaje en el g√©nero FPS. Han sido muchos a√±os de desarrollo, una reconversi√≥n desde el cancelado Doom 4 y un estilo propio que no desaparece con el paso de los a√±os. Este Doom de 2016 est√° m√°s cerca de lo vintage que de las l√≠neas maestras que definen el g√©nero a estas alturas. La propuesta del estudio id Software y Bethesda es cuanto menos arriesgada y no apta para todos los p√∫blicos, pero vamos a desgranar poco a poco sus distintos modos de juego y las experiencias distintas que encontrar√©is en cada uno de ellos.
Comenzando por su campa√±a, encontramos una poco inspirada en la narrativa, dejando que la balanza se incline totalmente hacia el lado de la jugabilidad. Doom presenta un estilo fren√©tico de juego en el que hay que ir encadenando muertes por el escenario y quedarte quieto o acorralado sin duda ser√° sin√≥nimo de muerte (no hacerlo tampoco asegura al cien por cien la supervivencia. Este estilo tan r√°pido y fluido de combate adem√°s trae algo de la vieja escuela a un g√©nero donde todos quieren ser Call of Duty, Battlefield o como mucho Far Cry.

Doom arriesga en su planteamiento, mostr√°ndose fiel a sus ra√≠ces y dando el toque justo de modernidad a su f√≥rmula. Es por ello que hay que aplaudir el m√©rito por traernos una experiencia seg√∫n fue planeada y que no se ha dejado influir por lo que podr√≠a asegurarles m√°s ventas. Doom no es un shooter para todos, requiere de cierta habilidad en el manejo de las mec√°nicas del g√©nero, que aqu√≠ son llevadas a su m√°xima expresi√≥n. Doom es un juego que separa el grano de la paja, que divide a los hombres de los ni√±os, y no hablamos solamente por su violencia desmedida.

Y es que el juego acaba siendo un espect√°culo gore con varios litros de sangre en pantalla por minuto. La jugabilidad de Doom, seg√∫n sus propias normas en las que se eliminan coberturas, apuntado y recarga de las armas, est√° muy enfocada a las ejecuciones de los enemigos. Cuando hemos causado un da√±o concreto a un enemigo nos aparecer√° un indicador visual que avisa de que el enemigo puede ser ejecutado con una de las variadas glory kills. Estas ejecuciones no son simplemente un deleite visual para ver lo bien trabajadas que est√°n las animaciones, sino que acaba siendo la clave de la supervivencia... y eso puede llegar a agotar al usuario.

Teniendo en cuenta la evidente falta de √≠tems de curaci√≥n, munici√≥n y objetos de escudo repartidos por el escenario, hay que terminar jugando con estas ejecuciones, ya que al acabar as√≠ con los enemigos, estos sueltan objetos de vida. Es por ello que en los numerosos tiroteos ser√° com√∫n el dejar enemigos inferiores vivos para ejecutarlos cuando mejor nos convenga. Este patr√≥n tiene que acabar repiti√©ndose una y otra vez y a las pocas horas de juego, lo que al comienzo eran animaciones distintas para cada tipo de enemigo e incluso variantes seg√∫n por d√≥nde se ejecute al enemigo, acaban por ser una pesadez que deja de divertir pero que hay que seguir haciendo hasta la saciedad.<p></div></div><div></section></body><br><br><?php include("../Comentarios/index.php");?><br><div name = "footer" id = "footer"><?php include("../../../d/Parte/footer.html"); ?></div></html>